import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = { profile: "" };
  }

  componentDidMount() {
    this.fetchProfile();
  }

  fetchProfile = () => {
    fetch("https://randomuser.me/api/")
      .then(function(response) {
        return response.json();
      })
      .then(myJson => {
        const { results } = myJson;
        console.log(results);

        this.setState({ profile: results[0] });
      });
  };

  render() {
    const { profile: { email } } = this.state;
    console.log(email);
    return (
      <div className="App">
        <div className="Card"> {email}</div>
      </div>
    );
  }
}

export default App;
